// SPDX-License-Identifier: MIT
pragma solidity ^ 0.8.0;

contract Hospital{
		uint public patientCount;

		struct Patient {
				address patientAddress;
				string name;
				uint age;
				uint contact;
				string userAddress;
				uint prescriptionCount;
				uint receiptCount;
				uint recordCount;
				Prescription[] prescriptions;
				Record[] records;
				Receipt[] receipts;
				Doctor [] doctor;

		}

		struct HealthCare {
				string name;
				uint contact;
				string HospitalAddress;
				address healthCareID;
				uint patientsCount;
				Doctor [] doctors;
				Pharmacy [] pharmacy;
		}
		struct Doctor {
    			address doctorAddress;
    			string name;
    			string designation;
    			uint recordCount;
		}

		struct Pharmacy {
			address pharmacyAddress;
			Doctor [] doctor;
		}



		struct Record {
				uint recordid;
				string disease;
				address doctorAddress;
				uint256 timestamp;
		}

		struct Receipt {
				uint receiptid;
				address doctorAddress;
				uint256 timestamp;
				uint totalcost;
				string drugname;
				uint drugCount;
				uint256 receiptNumber;
		}

		struct Prescription {
				uint prescriptionid;
				address healthCareAddress;
				uint256 timestamp;
				string drugname;
				uint drugCount;
		}
        event AddPatient(
				uint id,
				address patientAddress,
				string name,
				uint age,
				uint contact,
				string userAddress
		);
		event AddDoctor(
			uint id, 
			address doctorAddress, 
			string name, 
			string designation
		);

		event PatientExists(
				string description
		);

		event AddPrescription(
				uint prescriptionid,
				address healthCareAddress,
				string drugname,
				uint256 timestamp
		);

		event AddRecord(
				uint recordid,
				string disease,
				address doctorAddress,
				uint256 timestamp
		);

		event AddReceipt(
				uint receiptid,
				address doctorAddress,
				string drugname,
				uint256 timestamp,
				uint totalcost,
				uint256 receiptNumber,
				uint drugCount
		);

        mapping (uint => Patient) public patients;
		mapping (uint => Doctor) public doctors; 
        mapping (address => uint) addressToIndex;
		mapping (address => uint) addressToIndexDoctor;
		mapping(address => bool) public doctorExists;
		uint[] public patientsList;
		uint[] public doctorsList;
		uint public doctorCount;

		function setDoctor(address _doctorAddress, string memory _name, string memory _designation) public {
       		require(!doctorExists[_doctorAddress], "Doctor already exists");    
    		uint id = doctorCount + 1;
    		Doctor storage doctor = doctors[id];
    		doctor.doctorAddress = _doctorAddress;
    		doctor.name = _name;
    		doctor.designation = _designation;
			addressToIndexDoctor[_doctorAddress] = doctorCount;

    		doctorExists[_doctorAddress] = true;
    		doctorsList.push(id);
   			doctorCount++;

    		emit AddDoctor(id, _doctorAddress, _name, _designation);
}

function setPatient(address _patientAddress, string memory _name, uint _age, uint _contact, string memory _userAddress) public {
		bool patientExists = false;
		uint id = patientCount + 1;
		for (uint i = 1; i <= patientCount; i++) {
				if (patients[i].patientAddress == _patientAddress) {
						patientExists = true;
						id = i;
						break;
				}
		}
		if (!patientExists) {
				Patient storage patient = patients[id];

				patient.patientAddress = _patientAddress;
				patient.name = _name;
				patient.age = _age;
				patient.contact = _contact;
				patient.userAddress = _userAddress;
				patient.prescriptionCount = 0;
				patient.receiptCount = 0;
				patient.recordCount = 0;
                addressToIndex[_patientAddress] = patientCount;

				patientsList.push(id);
				patientCount++;

				emit AddPatient(id, _patientAddress, _name, _age, _contact, _userAddress);
		} else {
				emit PatientExists ("h");
		}
}
function getPatientCount() public view returns (uint) {
				return patientCount;
		}
function getDoctorCount() public view returns (uint) {
				return doctorCount;
	}
        function getPatientfromAddress(address _address) public view returns (address, string memory, uint, uint, string memory) {
						uint patientIndex = 0;
                        patientIndex = addressToIndex[_address];
						Patient storage patient = patients[patientIndex];
						return (patient.patientAddress, patient.name, patient.age, patient.contact, patient.userAddress);
		}
        

		function getCount(address _patientAddress) public view returns (uint, uint, uint) {
			    uint patientIndex = 0;
                patientIndex = addressToIndex[_patientAddress];
				Patient storage patient = patients[patientIndex];
				return (patient.recordCount, patient.prescriptionCount, patient.receiptCount);
		}
		
		function getPrescriptionfromAddress(address _patientAddress, uint _index) view public returns (uint, address, uint256, uint, string memory) {
		uint patientIndex = 0;
        patientIndex = addressToIndex[_patientAddress];
	
		return (
				patients[patientIndex].prescriptions[_index].prescriptionid,
				patients[patientIndex].prescriptions[_index].healthCareAddress,
				patients[patientIndex].prescriptions[_index].timestamp,
				patients[patientIndex].prescriptions[_index].drugCount,
		patients[patientIndex].prescriptions[_index].drugname
		);
}


function getReceiptfromAddress(address _patientAddress, uint _index) view public returns (uint,address,uint256,uint,string memory,uint,uint256) {
		uint patientIndex = 0;
        patientIndex = addressToIndex[_patientAddress];
	
		return (
				patients[patientIndex].receipts[_index].receiptid,
		patients[patientIndex].receipts[_index].doctorAddress,
		patients[patientIndex].receipts[_index].timestamp,
		patients[patientIndex].receipts[_index].totalcost,
		patients[patientIndex].receipts[_index].drugname,
		patients[patientIndex].receipts[_index].drugCount,
		patients[patientIndex].receipts[_index].receiptNumber
        
		);
}


function setDiagnosisfromID(uint _patientid,string memory _disease,address _doctorAddress) public {
		Patient storage patient = patients[_patientid];
		Record memory temp;
		uint id = patient.recordCount + 1;
		temp.recordid = id;
		temp.disease = _disease;
		temp.doctorAddress = _doctorAddress;
		temp.timestamp = block.timestamp;
		patient.records.push(temp);
		patient.recordCount++;
		emit AddRecord(id,_disease,_doctorAddress,block.timestamp);
}
function getDiagosisfromAddress(address _patientAddress, uint _index) view public returns (string memory, uint, uint, string memory, address, uint256) {
		uint patientIndex = 0;
        patientIndex = addressToIndex[_patientAddress];
	
		return (
		patients[patientIndex].name,
		patients[patientIndex].age,
				patients[patientIndex].records[_index].recordid,
				patients[patientIndex].records[_index].disease,
				patients[patientIndex].records[_index].doctorAddress,
				patients[patientIndex].records[_index].timestamp
		);
}
function setReceiptfromAddress(address _patientAddress,address _doctorAddress,string memory _drugname,uint _totalcost,uint _drugCount, uint256 _receiptNumber) public {
		uint patientIndex = 0;
        patientIndex = addressToIndex[_patientAddress];
		Patient storage patient = patients[patientIndex];
		Receipt memory temp;
		uint id = patient.receiptCount + 1;
		temp.receiptid = id;
		temp.doctorAddress = _doctorAddress;
		temp.timestamp = block.timestamp;
		temp.totalcost = _totalcost;
		temp.drugname = _drugname;
		temp.drugCount = _drugCount;
		temp.receiptNumber =_receiptNumber;
		patient.receipts.push(temp);
		patient.receiptCount++;

		emit AddReceipt(id,_doctorAddress,_drugname,block.timestamp,_totalcost,_receiptNumber,_drugCount);
}
function setPrescriptionfromAddress(address _patientAddress,address _healthCareAddress ,string memory _drugname, uint _drugCount) public {
        uint patientIndex = 0;
        patientIndex = addressToIndex[_patientAddress];
		require(patientIndex != 0, "Patient not found.");

		Patient storage patient = patients[patientIndex];
		Prescription memory temp;
		uint id = patient.prescriptionCount + 1;
		temp.prescriptionid = id;
		temp.healthCareAddress = _healthCareAddress;
		temp.timestamp = block.timestamp;
		temp.drugname = _drugname;
		temp.drugCount = _drugCount;
		patient.prescriptions.push(temp); // add the new prescription object to the patient's prescriptions array
		patient.prescriptionCount++;

		emit AddPrescription(id, _healthCareAddress, _drugname, block.timestamp);
}
}
